            </span>
          </div>
          <div className="info-text">
            <span>Texto 1</span>
            <span>Frase Informativa</span>
          </div>
        </div>
        <table className="leaderboard">
          <thead>
            <tr>
              <th>#</th>
              <th>Avatar</th>
              <th>Nombre</th>
              <th>Puntos</th>
            </tr>
          </thead>
          <tbody>
            {users.map((user, index) => (
              <tr key={user.id}>
                <td>{index + 1}</td>
                <td>{user.avatar}</td>
                <td>{user.name}</td>
                <td>{user.points}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    );
};

export default Posiciones;
